import React from "react";
import NavBar from "./NavBar";
import "./Main.css";
import FadeIn from "react-fade-in";

function Main() {
  return (
    <div className="container">
      <NavBar />
      <FadeIn>
        <div>
          {" "}
          Wir sind ein JUNGES, dynamisches Unternehmen das sich auf über 20
          JAHRE ERFAHRUNG im Bau- und Immobilienbereich stützt. Von der
          PROJEKTENTWICKELUNG, ANBAUTEN, AUSBAU oder UMGESTALTUNG von WOHN-,
          GESCHÄFTS-, BÜROHÄUSERN, bis hin zum NEUBAU.
        </div>
      </FadeIn>
    </div>
  );
}

export default Main;
